import React, { Component } from "react";

//Components
import CustomMenu from "../components/custom-menu/custom-menu";

class Ventes extends Component {
  constructor(props) {
    super(props);

    this.state = {
      toRegister: false
    };
  }

  handleNavigate = e => {
    e.preventDefault();
    this.setState({ toRegister: true });
  };

  render() {
    return (
      <CustomMenu screenName="Ventes">
        <div className="prueba-de-contenido">
          <h3>Ventes</h3>
        </div>
      </CustomMenu>
    );
  }
}

export default Ventes;
